I have a beretta 92fs  for trade. It is in good condition, has the regular black grips and a set of wood grips too. The only real wear on it is the top of the barrel where the slide moves across it, but that is just normal wear from shooting the gun. The reason I am trading it is I want to get into competitive shooting and want a gun more suited for that. This gun works perfectly.  The trigger on this gun is just awesome. It has the metal trigger instead of the plastic ones they are coming with today which is also nice;
If you want pictures, Im going to upload them here after I get out of work tonight. Otherwise let me know and I will also email them to you.
Thanks for looking!
